--SOLUTION 4-CREATE ACCOUNT_OPENING_APPLICATION TABLE AND INSERT 2000 RECORDS.
--THIS TABLE IS CONNECT WITH BANK,CUSTOMER AND EMPLOYEE TABLE.

--CREATING ACCOUNT_OPENING_APPLICATION TABLE

CREATE TABLE ACCOUNT_OPENING_APPLICATION (
    APPLICATION_ID SERIAL PRIMARY KEY,
    APPLICANT_NAME VARCHAR(100) NOT NULL,
    ACCOUNT_TYPE VARCHAR(20) CHECK (ACCOUNT_TYPE IN ('Savings', 'Current', 'Salary')),
    APPLICATION_DATE DATE NOT NULL,
    STATUS VARCHAR(20) CHECK (STATUS IN ('Pending', 'Approved', 'Rejected')) DEFAULT 'Pending',
    CUSTOMER_ID INT NOT NULL,
    EMPLOYEE_ID INT NOT NULL,
    BANK_ID INT NOT NULL,
    FOREIGN KEY (CUSTOMER_ID) REFERENCES CUSTOMER(CUST_ID),
    FOREIGN KEY (EMPLOYEE_ID) REFERENCES EMPLOYEE(EMP_ID),
    FOREIGN KEY (BANK_ID) REFERENCES BANK(BANK_ID)
);
